import React from 'react'
import Post from '../../../Pages/Post/Post'
import styles from './HomeContainer.module.css'

export default function HomeContainer ({posts}) {
    return (
        <div className={styles.homeContainer}>
            {posts.map((params)=>(
                <Post post={params}/>
            ))}
        </div>
    )
}
